export let ToastPresets;

(function (ToastPresets) {
  ToastPresets["GENERAL"] = "general";
  ToastPresets["SUCCESS"] = "success";
  ToastPresets["FAILURE"] = "failure";
  ToastPresets["OFFLINE"] = "offline";
})(ToastPresets || (ToastPresets = {}));
